INSERT INTO `ad` (`id`, `title`, `type`, `duration`, `start`, `espa`, `salary`, `shift_start`, `shift_end`, `no_of_vacancies`, `job_description`, `required_qualification`, `wanted_qualification`, `company_offers`, `deleted`, `state`, `date`, `company_id`, `object`) VALUES
(1, 'Βοηθός Λογιστή', 'Πλήρης', '3', '2023-02-15', 'Χωρίς ΕΣΠΑ', 700, '09:00:00', '17:00:00', 3, '- Τήρηση Μισθοδοσίας.\r\n- Σύνταξη και υποβολή δηλώσεων ΦΠΑ, VIES, Intrastat, και παρακρατούμενων φόρων.\r\n- Καταχώρηση παραστατικών\r\n- Ενημέρωση βιβλίων απλογραφικών.', '- Άριστη γνώση υπολογισμού μισθοδοσίας, προσλήψεων, αποχωρήσεων και καταχώρησης τιμολογίων με απλογραφική και διπλογραφική μέθοδο.\r\n- Άριστη χρήση ηλεκτρονικών υπολογιστών.', '- Πολύ καλή γνώση εφαρμογών λογιστικών προγραμμάτων.\r\n- Πολύ καλή γνώση αγγλικών.', '- Συνεχή επαγγελματική εκπαίδευση.\r\n- Άριστο επαγγελματικό περιβάλλον.', 0, 'Δημοσιευμένη', '2023-01-06', 2, 'Οικονομικά'),
(2, 'Βοηθός Λογιστή 2', 'Πλήρης', '3', '2023-02-15', 'Χωρίς ΕΣΠΑ', 700, '09:00:00', '17:00:00', 3, '- Τήρηση Μισθοδοσίας. \r\n- Σύνταξη και υποβολή δηλώσεων ΦΠΑ, VIES, Intrastat, και παρακρατούμενων φόρων. \r\n- Καταχώρηση παραστατικών \r\n- Ενημέρωση βιβλίων απλογραφικών.', '- Άριστη γνώση υπολογισμού μισθοδοσίας, προσλήψεων, αποχωρήσεων και καταχώρησης τιμολογίων με απλογραφική και διπλογραφική μέθοδο.\r\n- Άριστη χρήση ηλεκτρονικών υπολογιστών.', '- Πολύ καλή γνώση εφαρμογών λογιστικών προγραμμάτων.\r\n- Πολύ καλή γνώση αγγλικών.', '- Συνεχή επαγγελματική εκπαίδευση.\r\n- Άριστο επαγγελματικό περιβάλλον.', 0, 'Δημοσιευμένη', '2023-01-06', 2, 'Οικονομικά'),
(3, 'Web Developer', 'Μερική', '6', '2023-02-18', 'Χωρίς ΕΣΠΑ', 700, '09:00:00', '13:00:00', 2, '- Σχεδιασμός, ανάπτυξη και εφαρμογή αναφορών, αξιοποιώντας τα διαθέσιμα εργαλεία που του δίνονται\r\n- Υποστήριξη και βελτίωση των υπαρχουσών αναφορών και ανάπτυξη νέων\r\n- Παροχή τεχνικής υποστήριξης σε πελάτες\r\n- Έρευνα και ανάπτυξη νέων στατιστικών τεχνολογιών και αναλύσεων', '- PHP, Javascript / JQuery, HTML, CSS, MySQL\n- Αναλυτική σκέψη και ευχέρεια στην επικοινωνία.\n- Ευελιξία, προσαρμοστικότητα και ομαδικό πνεύμα εργασίας.', '- Bασικές γνώσεις Photoshop\n- Γνώσεις Wordpress – Woocommerce', '- Εμπειρία στα web applications και API\'s.\n- Εμπειρία σε πραγματικό εργασιακό περιβάλλον.', 0, 'Δημοσιευμένη', '2023-01-07', 3, 'Πληροφορική'),
(15, 'Full Stack Web Developer', 'Πλήρης', '3', '2023-02-28', 'Με ΕΣΠΑ', 0, '09:00:00', '13:00:00', 1, '- Back-end development για web applications με PHP.\r\n- Front-end development.\r\n- Συνεργασία με graphic designers για web design features.\r\n- Ενασχόληση με ένα project σε όλα τα στάδια υλοποίησης του.', '- PHP, Javascript / JQuery, HTML, CSS, MySQL\n- Αναλυτική σκέψη και ευχέρεια στην επικοινωνία.\n- Ευελιξία, προσαρμοστικότητα και ομαδικό πνεύμα εργασίας.', '- Bασικές γνώσεις Photoshop\n- Γνώσεις Wordpress – Woocommerce', '- Εμπειρία στα web applications και API\'s.\n- Εμπειρία σε πραγματικό εργασιακό περιβάλλον.', 0, 'Δημοσιευμένη', '2023-01-16', 3, 'Πληροφορική'),
(35, 'Software Developer 2', 'Πλήρης', '3', '2023-03-04', 'Με ΕΣΠΑ', 0, '09:00:00', '17:00:00', 1, '- Προσαρμογή υπαρχόντων κωδίκων για την δημιουργία νέων εφαρμογών. \\r\\n- Επικοινωνία με τους πελάτες για τον προσδιορισμό των χαρακτηριστικών των νέων εφαρμογών. \\r\\n- Δημιουργία νέων εφαρμογών για την κάλυψη νέων αναγκών.', '- C++ \\r\\n- MS SQL, MySQL, SQLite', '- Πολύ καλή γνώση Αγγλικών \\r\\n- Οργανωτική ικανότητα, συνέπεια, ικανότητα εργασίας σε συνθήκες πίεσης και επίλυσης σύνθετων θεμάτων  ', '- Ήρεμο και υγιές περιβάλλον εργασίας  \\r\\n- Προοπτικές εξέλιξης', 0, 'Προσωρινά Αποθηκευμένη', '2023-01-22', 3, 'Πληροφορική'),
(37, 'Software Developer', 'Πλήρης', '3', '2023-03-04', 'Με ΕΣΠΑ', 0, '09:00:00', '17:00:00', 1, '- Προσαρμογή υπαρχόντων κωδίκων για την δημιουργία νέων εφαρμογών. \r\n- Επικοινωνία με τους πελάτες για τον προσδιορισμό των χαρακτηριστικών των νέων εφαρμογών. \r\n- Δημιουργία νέων εφαρμογών για την κάλυψη νέων αναγκών.', '- C++ \r\n- MS SQL, MySQL, SQLite', '- Πολύ καλή γνώση Αγγλικών \r\n- Οργανωτική ικανότητα, συνέπεια, ικανότητα εργασίας σε συνθήκες πίεσης και επίλυσης σύνθετων θεμάτων  ', '- Ήρεμο και υγιές περιβάλλον εργασίας  \r\n- Προοπτικές εξέλιξης', 0, 'Δημοσιευμένη', '2023-01-22', 3, 'Πληροφορική');
